import React, { useState } from "react";

function TimelineInitialTypes(props) {

    function chooseType(e) {
        props.setTypeVal(e.target.getAttribute("data-index"))
    };

    return(
        <div className="timelineInitialTypes" data-index={props.i} onClick={chooseType}>
            <img src={props.imageOptions[props.index]} className="timelineInitialTypesImg"></img>
            <p className="timelineInitialTypesText">{props.types[props.index]}</p>
        </div>
    );
};

export default TimelineInitialTypes;
